import React from "react";

const SearchBar = () => {
    return (
        <div className="container">
            <div class="row">
                <section className="col s4 offset-s4">
                    <form action="">
                        <div className="input-field">
                            <input placeholder="Search for a Movie" type="text" />
                        </div>
                    </form>
                </section>
            </div>
        </div>
    )
}

export default SearchBar;
